class Solution {
    private static final int MOD = 1000000007;

    public int count(String num1, String num2, int min_sum, int max_sum) {
        return (findCount(num2, max_sum) - findCount(num1, min_sum - 1) + MOD) % MOD;
    }

    private int findCount(String num, int limit) {
        int[][][] dp = new int[num.length()][2][limit + 1];
        for (int i = 0; i < num.length(); i++) {
            for (int j = 0; j < 2; j++) {
                for (int k = 0; k <= limit; k++) {
                    dp[i][j][k] = -1;
                }
            }
        }
        return dfs(num, 0, 0, 0, limit, dp);
    }

    private int dfs(String num, int pos, int tight, int sum, int limit, int[][][] dp) {
        if (sum > limit) return 0;
        if (pos == num.length()) return 1;
        if (dp[pos][tight][sum] != -1) return dp[pos][tight][sum];
        int res = 0;
        int end = tight == 1 ? num.charAt(pos) - '0' : 9;
        for (int i = 0; i <= end; i++) {
            res = (res + dfs(num, pos + 1, tight == 1 && i == end ? 1 : 0, sum + i, limit, dp)) % MOD;
        }
        dp[pos][tight][sum] = res;
        return res;
    }
}
